import React, { useState } from 'react';
import FadeInSection from '../components/FadeInSection';
import TechPill from '../components/TechPill';

const TechSection = () => {
  const [selectedSection, setSelectedSection] = useState('');
  const [selectedTech, setSelectedTech] = useState(null);

  const handleTechClick = (section, tech) => {
    if (selectedSection === section && selectedTech === tech) {
      setSelectedSection('');
      setSelectedTech(null);
    } else {
      setSelectedSection(section);
      setSelectedTech(tech);
    }
  };

  return (
    <div className="bg-softBg dark:bg-black min-h-screen flex items-center justify-center relative overflow-hidden">
      {/* Background decoration */}
      <div className="absolute top-20 left-20 w-32 md:w-64 h-32 md:h-64 bg-purple/5 rounded-full blur-2xl md:blur-3xl" />
      <div className="absolute bottom-20 right-20 w-32 md:w-64 h-32 md:h-64 bg-blue/5 rounded-full blur-2xl md:blur-3xl" />
      
      <div className="container mx-auto px-4 max-w-4xl relative">
        <FadeInSection delay={200}>
          <h2 className="text-3xl font-sans lowercase font-light text-textPrimary mb-6 text-center mt-4">
            technologies i work with.
          </h2>
        </FadeInSection>

        <div className="max-w-3xl mx-auto space-y-8">
          {/* Languages Section */}
          <FadeInSection delay={400}>
            <div className="relative group">
              <div className="absolute inset-0 bg-gradient-to-r from-blue/5 via-blue/5 to-blue/5 rounded-2xl -m-2 blur-xl transition-all duration-500 group-hover:blur-2xl" />
              <div className="relative">
                <h3 className="text-lg font-sans lowercase text-textPrimary/60 mb-6 text-center">
                  programming languages
                </h3>
                <div className="flex flex-wrap justify-center gap-3">
                  {['python', 'javascript', 'html', 'css', 'sql'].map((lang) => (
                    <TechPill 
                      key={lang} 
                      tech={lang} 
                      onClick={() => handleTechClick("languages", lang)}
                      isActive={selectedSection === "languages" && selectedTech === lang}
                    />
                  ))}
                </div>
              </div>
            </div>
          </FadeInSection>

          {/* Frameworks Section */}
          <FadeInSection delay={600}>
            <div className="relative group">
              <div className="absolute inset-0 bg-gradient-to-r from-blue/5 via-blue/5 to-blue/5 rounded-2xl -m-2 blur-xl transition-all duration-500 group-hover:blur-2xl" />
              <div className="relative">
                <h3 className="text-lg font-sans lowercase text-textPrimary/60 mb-6 text-center">
                  frameworks & libraries
                </h3>
                <div className="flex flex-wrap justify-center gap-3">
                  {['node.js', 'express.js', 'jquery', 'bootstrap', 'ejs'].map((tech) => (
                    <TechPill 
                      key={tech} 
                      tech={tech} 
                      onClick={() => handleTechClick("frameworks", tech)}
                      isActive={selectedSection === "frameworks" && selectedTech === tech}
                    />
                  ))}
                </div>
              </div>
            </div>
          </FadeInSection>

          {/* Tools Section */}
          <FadeInSection delay={800}>
            <div className="relative group">
              <div className="absolute inset-0 bg-gradient-to-r from-blue/5 via-blue/5 to-blue/5 rounded-2xl -m-2 blur-xl transition-all duration-500 group-hover:blur-2xl" />
              <div className="relative">
                <h3 className="text-lg font-sans lowercase text-textPrimary/60 mb-6 text-center">
                  tools & software
                </h3>
                <div className="flex flex-wrap justify-center gap-3">
                  {['git', 'vs code', 'terminal','photoshop', 'fl studio'].map((tool) => (
                    <TechPill 
                      key={tool} 
                      tech={tool} 
                      onClick={() => handleTechClick("tools", tool)}
                      isActive={selectedSection === "tools" && selectedTech === tool}
                    />
                  ))}
                </div>
              </div>
            </div>
          </FadeInSection>
        </div>
      </div>
    </div>
  );
};

export default TechSection;
